DROP TABLE IF EXISTS "Chapter";
CREATE TABLE 'Chapter' ('No' INTEGER PRIMARY KEY  NOT NULL , 'SentIndex' INTEGER, 'Name' TEXT);
DROP TABLE IF EXISTS "Font";
CREATE TABLE 'Font' ('KEY' TEXT PRIMARY KEY  NOT NULL , 'IMG' BLOB NOT NULL );
DROP TABLE IF EXISTS "Sentence";
CREATE TABLE 'Sentence' ('ID' INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL , 'BeginTime' REAL NOT NULL , 'EndTime' REAL NOT NULL , 'ORG' TEXT NOT NULL , 'TRL' TEXT NOT NULL , 'EXT' TEXT, 'IMG' BLOB);
DROP TABLE IF EXISTS "Stk";
CREATE TABLE 'Stk' ('KEY' TEXT PRIMARY KEY  NOT NULL , 'NUM' INTEGER, 'DATA' BLOB);
DROP TABLE IF EXISTS "Voc";
CREATE TABLE 'Voc' ('ID' INTEGER NOT NULL , 'KEY' TEXT NOT NULL , 'BeginTime' REAL NOT NULL , 'EndTime' REAL NOT NULL );
DROP TABLE IF EXISTS "android_metadata";
CREATE TABLE android_metadata (locale TEXT);
